import React from "react";
import ReactDOM from "react-dom";
import {arr,arr1,arr2 } from "./Mep";
 


const val=arr.map(function (index){
  return index;
});
const val1=arr1.map(function (index){
  return index;
});
const val2=arr2.map(function (index){
  return index;
});




ReactDOM.render(
  <>
  {val}
  {val1}
  {val2}
  </>
,document.getElementById('root'));
